import './App.css';
import bgImage from '../src/images/background.jpg'; 
import logo from '../src/images/logo.webp';
function App() {
  return (
    <div className="App">
      <img src={bgImage} alt="bgImage" className='bg-image'/>

      <img src={logo} alt="Logo" className='logo-image'/>
      <p>Arcgate Foundation, a not-for-profit initiative, focuses on improving the local community through programs in the areas of education, healthcare, sports and rural development. 
        Our mission is to support the less privileged sections of the society through various efforts that will help create a brighter future.</p>
    </div>
  );
}

export default App;
